import React from "react";

const Navbar9 = ({on}) => {
    return(
        <>
        
        <div className="floating-action-button">
      <button className="btn btn-primary btn-lg" onClick={onClick}>
        <i className="fa fa-plus"></i> {/* Use any icon library here or Bootstrap icons */}
      </button>
    </div>
        </>
    )
}
 export default Navbar9;
